pieces.style:
* {
    font-weight: normal;
}

.wrapper {
    background-color: white;
}

.line {
    width: 1px;
    background-color: #dadada;
    height: 48px;
    justify-self: center;
}

.grid {
    display: grid;
    grid-auto-flow: column;
    align-items: center;
    max-width: 1300px;
    margin: auto;
}

.container {
    display: grid;
    grid-auto-flow: column;
    align-items: center;
    gap: 10px;
}

a {
    color: #006afd;
    text-decoration: none;
}

p {
    margin: 0;
}

.icon-container {
    display: flex;
    justify-content: flex-end;
}

.card-icon {
    height: 28px;
}

.icon {
    height: 30px;
}

.flex-text {
display:flex;
gap: 4.5px;
}

@media (min-width: 1000px) {
    .mobile {
        display: none;
    }

    .desktop {
        display: grid;
    }

    .wrapper {
        display: flex;
        padding: 8px 0;
    }

    * {
        font-size: 14px;
    }

    .grid {
        grid-template-columns: max-content 32px max-content 32px max-content;
    }

    .icon {
        height: 34px;
    }

}


@media (max-width: 1000px) {
    .desktop {
        display: none;
    }

    .mobile {
        display: grid;
    }

    * {
        font-size: 13px;
    }

    .wrapper {
        padding: 8px 16px;
    }

    .grid {
        grid-template-columns: 1fr 12px 1fr;
    }

    .container {
        gap: 10px;
    }

    .icon-container {
        display: flex;
        justify-content: flex-end;
    }
}
